import React  from "react";

const What=(state)=>{
     const {items} = state;
  
return          
  (
    items.map=(item=>{
        return(
            <div>
                <h3>{item.id}</h3>
<h3>{item.name}</h3>
<h3>{item.age}</h3>
            </div>

        )
}
    )
)        
    
}
export default What;
